import { Component } from 'react';
import './style.css'
import iconHeader from '../../images/logo_azul.svg'
import 'font-awesome/css/font-awesome.min.css';
import Modal from '@bdenzer/react-modal';
class Header extends Component {
   constructor(props) {
      super(props);
      this.state = {
          shouldShowModal: false,
      }
      this.closeModal = this.closeModal.bind(this);
      this.openModal = this.openModal.bind(this);
    }

    closeModal() {
      this.setState({ shouldShowModal: false });
    }

    openModal() {
      this.setState({ shouldShowModal: true });
    } 
   render() {
      return (
         <div>
            <img src={iconHeader} alt="" className='iconHeader'/>
            <div className='containerHeader'>
            <span href='/' onClick={this.openModal} className='iconBar'><i className='fa fa-bars'></i></span>
               <div className='infoHeader'>
                  <a className='textHeader'>Nosotros</a>
                  <a className='textHeader'>Historia</a>
                  <a className='textHeader'>Labor Social</a>
                  <a className='textHeader'>Cr√®ditos</a>
                  <a className='textHeader'>Contacto</a>
               </div>
            </div>
            <div className='divScroll1'>
                    <Modal
                        closeModal={this.closeModal}
                        shouldShowModal={this.state.shouldShowModal}
                    >
                    <div className='modal'>
                        <p><a href='/'>MARCOS MANZO TORRES</a></p>
                        <p><a href='/resume'>RESUME</a></p>
                        <p><a href='/projects'>PROJECTS</a></p>
                        <p><a href='/contact'>CONTACT</a></p>
                    </div>
                    </Modal>
                </div>
         </div>
      )
   }
}
export default Header
